import React from "react";

const Detail = ({ key, subject, name, message, email }) => {
  return (
    <tr key={key}>
      <td>{name}</td>
      <td>{subject}</td>
      <td>{email}</td>
      <td>{message}</td>
    </tr>
  );
};

export default Detail;
